CREATE TABLE USER_INFO(
   USERID VARCHAR(50),
   ULEVEL NUMBER,
   UTIER VARCHAR(20),
   PRIMARY KEY (USERID),
   FOREIGN KEY (UTIER) REFERENCES TIER_INFO(TIER)
);

CREATE TABLE TIER_INFO(
   TIER VARCHAR(20),
   TIERIMG VARCHAR(100),
   PRIMARY KEY (TIER)
);

CREATE TABLE GAME_HISTORY(
   GAMEID NUMBER,
   GAMECODE VARCHAR(50),
   TEAMCOLOR VARCHAR(10),
   USERID VARCHAR(50),
   CHAMID VARCHAR(50),
   RUNEID VARCHAR(50),
   SPELLID VARCHAR(50),
   ITEMID VARCHAR(50),
   POS VARCHAR(10),
   KILL NUMBER(2),
   DEATH NUMBER(2),
   ASSIST NUMBER(2),
   KDA VARCHAR(10),
   ATTACK NUMBER,
   DAMAGE NUMBER,
   ISWIN VARCHAR(5),
   START_TIME DATE,
   END_TIME DATE,
   PRIMARY KEY (GAMEID),
   FOREIGN KEY (USERID) REFERENCES USER_INFO(USERID),
   FOREIGN KEY (CHAMID) REFERENCES CHAM_INFO(CHAMID),
   FOREIGN KEY (RUNEID) REFERENCES RUNE_INFO(RUNEID),
   FOREIGN KEY (SPELLID) REFERENCES SPELL_INFO(SPELLID),
   FOREIGN KEY (ITEMID) REFERENCES ITEM_INFO(ITEMID)
);
SELECT * FROM rune_info;
DROP TABLE GAME_HISTORY ;

CREATE TABLE CHAM_INFO(
	CHAMID VARCHAR(50),
	CHAMIMG VARCHAR(100),
	PRIMARY KEY (CHAMID)
);
CREATE TABLE RUNE_INFO(
	RUNEID VARCHAR(50),
	RUNEIMG VARCHAR(100),
	PRIMARY KEY (RUNEID)
);
CREATE TABLE SPELL_INFO(
	SPELLID VARCHAR(50),
	SPELLIMG VARCHAR(100),
	PRIMARY KEY(SPELLID)
);
CREATE TABLE ITEM_INFO(
   ITEMID VARCHAR(50),
   ITEMIMG VARCHAR(100),
   PRIMARY KEY (ITEMID)
);


DROP TABLE GAME_HISTORY;
DROP TABLE CHAM_INFO;
DROP TABLE USER_INFO;
DROP TABLE RUNE_INFO;
DROP TABLE ITEM_INFO;
DROP TABLE SPELL_INFO;


